import classes from "./ProjectLink.module.css";

const ProjectLink = () => {
  return (
    <div className={classes.row}>
      <div className={classes.column1}>
        <a
          href="https://github.com/shashiiitp19/Freshworks-Engineering-Assignment"
          target="_blank"
        >
          A Food Ordering App
        </a>
      </div>
      <div className={classes.column2}>
        <a href="http://localhost:3000/">My Own Web App</a>
      </div>
    </div>
  );
};

export default ProjectLink;
